SpectatorController::~SpectatorController() 
{
	if (m_mesh != nullptr)
		delete m_mesh;
	if (m_material != nullptr)
		delete m_material;
}

void SpectatorController::Update(const float& deltaTime) 
{
	const Keyboard* keyboard = GetEngine()->GetWindow()->GetKeyboard();
	Mouse* mouse = GetEngine()->GetWindow()->GetMouse();

	const bool running = keyboard->IsKeyDown(Keyboard::Key::KV_LSHIFT);
	const float speed = (running ? 36.0f : 7.0f) * deltaTime;


	// Recording
	{
		// Start recording
		if (!bIsPlayback && keyboard->IsKeyReleased(Keyboard::Key::KV_BACKSPACE))
		{
			bIsRecording = !bIsRecording;
			currentFrame.clear();
			LOG("Recording set:%i for '%s'", bIsRecording, demoFileName.c_str());

		}

		// Write recording to disk
		if (bIsRecording)
		{
			// Execute changes
			if (currentFrame.deltas.size() != 0)
			{
				// Perform changes
				currentFrame.results = currentVolume->Rebuild(currentFrame.deltas, nullptr);

				// Save to recording file
				std::ofstream file(demoFileName, std::ofstream::app | std::ofstream::binary);

				// Record deltas
				{
					uint32 count = currentFrame.deltas.size();
					file.write(reinterpret_cast<const char*>(&count), sizeof(uint32));

					const void* data = currentFrame.deltas.data();
					file.write(reinterpret_cast<const char*>(currentFrame.deltas.data()), currentFrame.deltas.size() * sizeof(VoxelDelta));
				}

				// Record results
				{
					const void* data;

					data = &currentFrame.results.insertTime;
					file.write(reinterpret_cast<const char*>(data), sizeof(int64));
					data = &currentFrame.results.totalTime;
					file.write(reinterpret_cast<const char*>(data), sizeof(int64));

					uint32 count = currentFrame.results.buildTime.size();
					file.write(reinterpret_cast<const char*>(&count), sizeof(uint32));

					data = currentFrame.results.buildTime.data();
					file.write(reinterpret_cast<const char*>(data), count * sizeof(int64));

					data = currentFrame.results.tricount.data();
					file.write(reinterpret_cast<const char*>(data), count * sizeof(uint32));
				}

				file.close();
				currentFrame.clear();
			}
		}
	}

	// Playback
	{
		// Start playback
		if (!bIsRecording && !bIsPlayback && keyboard->IsKeyReleased(Keyboard::Key::KV_ENTER))
		{
			bIsPlayback = true;
			playbackIndex = 0;
			playbackFrames.clear();
			LOG("Begin playback for '%s'", demoFileName.c_str());
			
			// Load file
			std::ifstream file(demoFileName, std::ofstream::binary);
			uint32 count;

			// Read all frames in the file
			do
			{
				VoxelFrame frame;

				// Read deltas
				{
					uint32 count;
					file.read(reinterpret_cast<char*>(&count), sizeof(uint32));
					frame.deltas.resize(count);

					void* data = frame.deltas.data();
					file.read(reinterpret_cast<char*>(frame.deltas.data()), frame.deltas.size() * sizeof(VoxelDelta));
				}

				// Read results
				{
					void* data;

					data = &frame.results.insertTime;
					file.read(reinterpret_cast<char*>(data), sizeof(int64));
					data = &frame.results.totalTime;
					file.read(reinterpret_cast<char*>(data), sizeof(int64));

					uint32 count;
					file.read(reinterpret_cast<char*>(&count), sizeof(uint32));
					frame.results.buildTime.resize(count);
					frame.results.tricount.resize(count);

					data = frame.results.buildTime.data();
					file.read(reinterpret_cast<char*>(data), count * sizeof(int64));

					data = frame.results.tricount.data();
					file.read(reinterpret_cast<char*>(data), count * sizeof(uint32));
				}

				playbackFrames.push_back(frame);
			} 
			while (file.good());
			file.close();

			// Delete last because dupe..??
			playbackFrames.erase(playbackFrames.begin() + playbackFrames.size() - 1);
			LOG("Read %i frames", playbackFrames.size());
		}

		// Play changes
		if (bIsPlayback)
		{
			VoxelFrame& frame = playbackFrames[playbackIndex++];
			frame.results = currentVolume->Rebuild(frame.deltas, &frame.results); // Replace results
			
			// Finished playback
			if (playbackIndex >= playbackFrames.size())
			{
				LOG("Playback finished");

				// TODO - Format results
				const uint32 count = playbackFrames[0].results.buildTime.size();
				float averageInsertTime = 0;
				std::vector<float> averageBuildTime{ 0 };
				std::vector<float> maxBuildTime{ 0 };
				std::vector<float> averageTriCount{ 0 };

				averageBuildTime.resize(count);
				maxBuildTime.resize(count);
				averageTriCount.resize(count);

				for (VoxelFrame& frame : playbackFrames)
				{
					averageInsertTime += frame.results.insertTime;

					for (uint32 i = 0; i < count; ++i)
					{
						averageBuildTime[i] += frame.results.buildTime[i];
						averageTriCount[i] += frame.results.tricount[i];

						if (maxBuildTime[i] < frame.results.buildTime[i])
							maxBuildTime[i] = frame.results.buildTime[i];
					}
				}

				averageInsertTime /= playbackFrames.size();
				LOG("Stats: Insert Time:%f", averageInsertTime);

				for (uint32 i = 0; i < count; ++i)
				{
					averageBuildTime[i] /= playbackFrames.size();
					averageTriCount[i] /= playbackFrames.size();

					LOG("LOD %i: Build Time:%f Count:%f Max Time:%f", i, averageBuildTime[i], averageTriCount[i], maxBuildTime[i]);
				}

				playbackFrames.clear();
				bIsPlayback = false;
			}

			return; // Don't allow interaction while play back
		}
	}


	// Movement
	{
		if (keyboard->IsKeyDown(Keyboard::Key::KV_W))
			m_transform.Translate(camera->GetForward() * speed);
		if (keyboard->IsKeyDown(Keyboard::Key::KV_S))
			m_transform.Translate(-camera->GetForward() * speed);

		if (keyboard->IsKeyDown(Keyboard::Key::KV_D))
			m_transform.Translate(camera->GetRight() * speed);
		if (keyboard->IsKeyDown(Keyboard::Key::KV_A))
			m_transform.Translate(-camera->GetRight() * speed);

		if (keyboard->IsKeyDown(Keyboard::Key::KV_SPACE))
			m_transform.Translate(vec3(0, speed, 0));
		if (keyboard->IsKeyDown(Keyboard::Key::KV_LCONTROL))
			m_transform.Translate(vec3(0, -speed, 0));



		if (mouse->IsButtonPressed(Mouse::Button::MB_MIDDLE) || keyboard->IsKeyPressed(Keyboard::Key::KV_G))
			mouse->SetGrabbed(!mouse->IsGrabbed());


		if (mouse->IsGrabbed())
		{
			const float turn = 1.18f * 0.05f;
			const vec2 vel = mouse->GetVelocity();

			vec3 rotation = m_transform.GetEularRotation() + vec3(-vel.y * turn, -vel.x * turn, 0.0f);
			if (rotation.x < -89.0f)
				rotation.x = -89.0f;
			if (rotation.x > 89.0f)
				rotation.x = 89.0f;

			rotation.y = std::fmodf(rotation.y, 360.0f);
			//if (rotation.y < 0.0f)
			//	rotation.y = 360.0f - rotation.y;

			m_transform.SetEularRotation(rotation);
		}

		camera->SetLocation(m_transform.GetLocation());
		camera->SetEularRotation(m_transform.GetEularRotation());
	}

	// Interaction
	{
		// Fetch for new interaction whenever mouse moves
		if (true || dot(mouse->GetVelocity(), mouse->GetVelocity()) > 0) // TODO - Take keyboard into account
		{
			bLookingAtVoxel = false;

			if (currentVolume != nullptr)
				bLookingAtVoxel = currentVolume->Raycast(Ray(m_transform.GetLocation(), m_transform.GetForward()), lookatVoxel, 1000.0f);
		}


		// Change shape size
		if (keyboard->IsKeyPressed(Keyboard::Key::KV_Q))
		{
			m_shapeSize++;
			if (m_shapeSize > 20)
				m_shapeSize = 5;
			LOG("Shape size %i", m_shapeSize);
		}

		// Shuffle shapes
		if (keyboard->IsKeyPressed(Keyboard::Key::KV_E))
		{
			switch (m_interactionShape)
				{
				case InteractionShape::Point:
					m_interactionShape = InteractionShape::Sphere;
					break;
				case InteractionShape::Sphere:
					m_interactionShape = InteractionShape::Cube;
					break;
				case InteractionShape::Cube:
					m_interactionShape = InteractionShape::Point;
					break;
			}

			LOG("Interaction shape %s",
				m_interactionShape == InteractionShape::Cube ? "CUBE" :
				m_interactionShape == InteractionShape::Point ? "POINT" :
				m_interactionShape == InteractionShape::Sphere ? "SPHERE" : "UNKNOWN"
			);
		}
		
		// Voxel interaction
		if (bLookingAtVoxel)
		{
			// Destroy/Destroy voxel
			const bool destroy = mouse->IsButtonPressed(Mouse::Button::MB_LEFT);
			const bool place = mouse->IsButtonPressed(Mouse::Button::MB_RIGHT);
			if (destroy || place)
			{
				switch (m_interactionShape)
				{
					case InteractionShape::Point:
					{
						ivec3 pos(
							lookatVoxel.coord.x,
							lookatVoxel.coord.y,
							lookatVoxel.coord.z
						);

						if (destroy)
						{
							float value = currentVolume->Get(pos.x, pos.y, pos.z);
							Set(pos.x, pos.y, pos.z, 0.0f);
						}
						if (place)
						{
							float value = currentVolume->Get(pos.x, pos.y, pos.z);
							Set(lookatVoxel.surface.x, lookatVoxel.surface.y, lookatVoxel.surface.z, 1.0f);
						}
						break;
					}

					case InteractionShape::Sphere:
					{
						const int32 radius = m_shapeSize / 2;

						for (int32 x = -radius; x <= radius; ++x)
							for (int32 y = -radius; y <= radius; ++y)
								for (int32 z = -radius; z <= radius; ++z)
								{
									const float length = glm::length(vec3(x, y, z)) / radius;

									ivec3 pos(
										lookatVoxel.coord.x + x,
										lookatVoxel.coord.y + y,
										lookatVoxel.coord.z + z
									);

									if (destroy)
									{
										float value = currentVolume->Get(pos.x, pos.y, pos.z);
										Set(pos.x, pos.y, pos.z, glm::min(1.0f, glm::min(length * currentVolume->GetIsoLevel(), value)));
									}
									if (place)
									{
										float value = currentVolume->Get(pos.x, pos.y, pos.z);
										Set(pos.x, pos.y, pos.z, glm::max(0.0f, glm::max(1.0f - length, value)));
									}
								}
						break;
					}

					case InteractionShape::Cube:
					{
						const int32 halfSize = m_shapeSize / 2;

						for (int32 x = -halfSize; x <= halfSize; ++x)
							for (int32 y = -halfSize; y <= halfSize; ++y)
								for (int32 z = -halfSize; z <= halfSize; ++z)
								{
									ivec3 pos(
										lookatVoxel.coord.x + x,
										lookatVoxel.coord.y + y,
										lookatVoxel.coord.z + z
									);

									if (destroy)
									{
										float value = currentVolume->Get(pos.x, pos.y, pos.z);
										Set(pos.x, pos.y, pos.z, 0.0f);
									}
									if (place)
									{
										float value = currentVolume->Get(pos.x, pos.y, pos.z);
										Set(pos.x, pos.y, pos.z, 1.0f);
									}
								}
						break;
					}
				}


			}
		}
	}
}

void SpectatorController::Draw(const Window* window, const float& deltaTime) 
{
	if (bLookingAtVoxel)
	{
		m_material->Bind(window, GetLevel());
		m_material->PrepareMesh(m_mesh);

		Transform t;
		t.SetLocation(lookatVoxel.coord);
		m_material->RenderInstance(&t);
		//t.SetLocation(lookatVoxel.surface);
		//m_material->RenderInstance(&t);
		m_material->Unbind(window, GetLevel());
	}
}

void SpectatorController::Set(const uint32& x, const uint32& y, const uint32& z, const float& value)
{
	if (!currentVolume)
		return;

	if (x < currentVolume->GetResolution().x && y < currentVolume->GetResolution().y && z < currentVolume->GetResolution().z)
	{
		if (bIsRecording)
		{
			VoxelDelta delta{ {x,y,z}, value };
			currentFrame.deltas.push_back(delta);
		}
		else
			currentVolume->Set(x, y, z, value);
	}
}